import React from 'react';
import './App.css';

function App() {
    return (
        <div>

            <div className="navbar navbar-default">
                <ul className="nav navbar-nav">
                    <li className="active">
                        <a>Trang Chủ</a>
                    </li>
                    <li>
                        <a>Danh sách sản phẩm</a>
                    </li>
                </ul>
            </div>
        </div>
    );
}

export default App;
